import { useEffect } from 'react';
import Philosopher from '../components/Philosopher';

const Catalog = () => {
  useEffect(() => {
    document.title = 'Catalog';
  });

  return (
    <body id='catalog'>
      <div className='item-grid'>
        <Philosopher />
      </div>
    </body>
  );
};

export default Catalog;
